import React, { useState, useEffect } from "react";
import { Row, Col } from "react-bootstrap";
import Navigation from "../Component/Navigation";

const Api = () => {
  
  const [news , setNews] = useState([])
  useEffect(()=>{
    fetch("http://localhost:3000/articles").then((response)=>{
    response.json().then((promic2) =>{
        
      setNews(promic2)
      console.log(news)
    })
  })
  }, [])
  

  return (
    <>
      <Row><Navigation /></Row>
      <Row>Blog api </Row>
      <Row>
        <Col></Col>
        <Col>
          {
              news.map((key) =>{
                  return(
                      <>
                      <p>{key.author}</p>
                      
                          { key.map((key2)=>{
                              return(
                                  <>
                                  {key2.name}
                                  </>
                              )
                          })}
                      
                      </>
                  )
              })
          }
         
        </Col>
        <Col></Col>
      </Row>
    </>
  );
};
export default Api;
